import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenseItems = [[[21,2,2022],'Car Insurance',294.67],[[24,2,2022],'House Insurance',597.55],[[22,4,2022],'Food',800],[[27,7,2022],'Entrataiment',700]] 
  return (
    <div>
      <h2>Let's get started!</h2>
      {expenseItems.map(e => {[date,title,amount]=e; <ExpenseItem d={date} t={title} a={amount} />})}
    </div>
  );
}

export default App;
